import React, { Component} from "react";
import './About.css';

class About extends Component {
    render() {
        return(
            <div className="Main-About">
                <div className="pinkDiv">hey</div>
                <div></div>

                <div className="picDiv">hey again</div>
            </div>
        );
    }
} 

export default About;
